import React from "react";
import Navbar from "../components/Navbar";
import FlightSearch from "../components/FlightSearch";

const FlightsPage = () => {
  const handleSearch = (params: any) => {
    console.log("Căutare inițiată:", params);
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-blue-100 via-white to-blue-100">
      <Navbar />
      <main className="flex flex-col items-center px-8 py-20">
        <div className="bg-white rounded-2xl shadow-lg max-w-5xl w-full p-10">
          <h1 className="text-center text-4xl font-extrabold text-blue-900 mb-8 drop-shadow-sm">
            Caută un zbor
          </h1>
          <FlightSearch onSearch={handleSearch} />
        </div>
      </main>
    </div>
  );
};

export default FlightsPage;
